import{_ as t,c as a,o as r,ag as o}from"./chunks/framework.D4Vqf8I7.js";const u=JSON.parse('{"title":"Дисциплины","description":"","frontmatter":{},"headers":[],"relativePath":"docs/disciplines/index.md","filePath":"docs/disciplines/index.md","lastUpdated":1755775334000}'),p={name:"docs/disciplines/index.md"};function n(s,e,i,d,l,c){return r(),a("div",null,e[0]||(e[0]=[o('<h1 id="дисциплины" tabindex="-1">Дисциплины <a class="header-anchor" href="#дисциплины" aria-label="Permalink to &quot;Дисциплины&quot;">​</a></h1><p>Все дисциплины взяты из специальности 09.02.06 Сетевое и системное администрирование ФГОС 2023 и 2016 года.</p><p>Хотя более взято из ФГОСа 16 года. Например, структура профессиональных модулей.</p><p>Так как я работал с модулем: Эксплуатация объектов сетевой инфраструктуры (по выбору), соответственно тут будет информация по этому варианту. В дальнейшем, возможно, будут создаваться и другие варианты.</p><p>Весь материал, представленный здесь, это личный вариант материалов для специальности 09.02.06. Он не претендует на оригинальность или что-то подобное. В процессе работы накапливается много материалов, и возможно, они будут полезны кому-либо.</p><p>Все материалы взяты из сети, книг и прочих источников. Надеюсь, копирайты меня не того... Буду стараться по максимуму прописывать все источники.</p><p>Материалы будут появляться очень медленно, ввиду того, что планируется их доработка/переработка с учётом требований ДЭ и реалиями импортозамещения в РФ. Упор будет на Альт Линкс.</p><p>Если кто-то желает присоединиться к разработке, можете создавать пул реквесты в Гитхаб или писать мне на почту.</p><p>Надеюсь, эти материалы помогут преподавателям и студентам в своём трудном и захватывающем пути освоения сетевого и системного администрирования.</p><p>Спасибо!</p><hr><p><a href="https://uneex.ru/LecturesCMC" target="_blank" rel="noreferrer">https://uneex.ru/LecturesCMC</a> - Георгий Курячий</p><p><a href="https://iksweb.ru/tools/generator-table-html/" target="_blank" rel="noreferrer">https://iksweb.ru/tools/generator-table-html/</a></p><p><a href="https://docs.cntd.ru/document/902389617?marker=1HDI9IB&amp;section=text" target="_blank" rel="noreferrer">https://docs.cntd.ru/document/902389617?marker=1HDI9IB&amp;section=text</a></p><p><a href="https://xn--273--84d1f.xn--p1ai/voprosy_i_otvety/vprave-li-professionalnaya-obrazovatelnaya-organizaciya-ne-dopustit-studenta-do" target="_blank" rel="noreferrer">https://273-фз.рф/voprosy_i_otvety/vprave-li-professionalnaya-obrazovatelnaya-organizaciya-ne-dopustit-studenta-do</a></p>',15)]))}const h=t(p,[["render",n]]);export{u as __pageData,h as default};
